(4, 'About Us', '<p style=\"text-align: justify;\">We are providing the original product directly from producers. Our specialties right now are the top-notch premium quality dates of Saudi Arabia. More products from various <span style=\"font-family: tahoma, arial, helvetica, sans-serif;\">countries</span> are coming soon. The ultimate customer satisfaction is our main goal. Thanks for being with ZamZam Trading BD.<br />Saudi Arab is the first world country of number of areas and factories that produce dates, all in one country. There are more than great oases and several minor ones, in addition to (130) factories of dates. This characteristic makes Saudi Arab is the first duration for ones who know value of the healthy dates and blessings in land of the two venerable sanctuaries. Varieties of dates good value brings a real pleasure for who want to get blessings, quality and flavors of dates in different areas and oases.</p>', '<p style=\"text-align: justify;\">Ensuring year-round supply of premium quality dates from other Middle Eastern countries including Saudi Arabia, one of the best date producing countries in the world. Involve ourselves in increasing the country\'s revenue by exporting consumer and agricultural products from Bangladesh to the Middle East.</p>', '<p style=\"box-sizing: inherit; margin: 0px 0px 2rem; font-weight: 400; font-size: 14px; line-height: 1.86; color: #666666; font-family: Poppins, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; transition: all 0s ease 0s !important; text-align: justify;\">Ensuring the most premium dates of Saudi Arabia mainly for the consumers of Bangladesh. Ensure supply of imported dates and other products. Arranging home delivery with our own delivery management to customers. We have specialized business support for wholesalers and retailers. Dedicated support team is always there to help all customers.</p>', NULL, '1637336716.jpg', NULL, 'product_banner1637336419.jpg', NULL, '2021-09-26 05:07:24', '2022-03-01 10:06:02'),
(5, 'Privacy Policy', '<h1 style=\"text-align: center;\">Privacy Policy</h1>\r\n<p style=\"text-align: justify;\"><strong>Effective Date: 20-03-2023</strong></p>\r\n<p style=\"text-align: justify;\"><strong>Your privacy is important to us</strong></p>\r\n<p style=\"text-align: justify;\">Ullash is located at:</p>\r\n<p style=\"text-align: left;\">Ullash<br />3<sup>rd</sup> Floor, Pantha Nibash, Panthapath,<br />Dhaka , Bangladesh<br />Cell: +8801718964654</p>\r\n<p style=\"text-align: justify;\"><strong>Introduction</strong></p>\r\n<p style=\"text-align: justify;\">It is Ullash\'s policy to respect your privacy regarding any information we may collect while operating our website. This Privacy Policy applies to&nbsp;<a href=\"http://www.ullash.com.bd/\">www.ullash.com.bd</a>&nbsp;(hereinafter, \"us\", \"we\", or \"www.Ullash.com.bd\"). We respect your privacy and are committed to protecting personally identifiable information you may provide us through the Website. We have adopted this privacy policy (\"Privacy Policy\") to explain what information may be collected on our Website, how we use this information, and under what circumstances we may disclose the information to third parties. This Privacy Policy applies only to information we collect through the Website and does not apply to our collection of information from other sources.</p>\r\n<p style=\"text-align: justify;\">This Privacy Policy, together with the Terms of service posted on our Website, set forth the general rules and policies governing your use of our Website. Depending on your activities when visiting our Website, you may be required to agree to additional terms of service.</p>\r\n<p style=\"text-align: left;\"><strong>Table of Contents</strong></p>\r\n<div><strong>1. Website Visitors</strong></div>\r\n<div><strong>2. Personally-Identifying Information</strong></div>\r\n<div><strong>3. Security</strong></div>\r\n<div><strong>4. Advertisements</strong></div>\r\n<div><strong>5. Ullash</strong><strong> uses Google AdWords for remarketing</strong></div>\r\n<div><strong>6. Protection of Certain Personally-Identifying Information</strong></div>\r\n<div><strong>7. Aggregated Statistics</strong></div>\r\n<div><strong>8. Affiliate Disclosure</strong></div>\r\n<div><strong>9. Cookies</strong></div>\r\n<div><strong>10. E-commerce</strong></div>\r\n<div><strong>11. Privacy Policy Changes</strong></div>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p><strong>1. Website Visitors</strong></p>\r\n<p style=\"text-align: justify;\">Like most website operators, Ullash collects non-personally-identifying information of the sort that web browsers and servers typically make available, such as the browser type, language preference, referring site, and the date and time of each visitor request. Ullash\'s purpose in collecting non-personally identifying information is to better understand how Ullash\'s visitors use its website. From time to time, Ullash may release non-personally-identifying information in the aggregate, e.g., by publishing a report on trends in the usage of its website.</p>\r\n<p style=\"text-align: justify;\">Ullash also collects potentially personally-identifying information like Internet Protocol (IP) addresses for logged in users and for users leaving comments on https://www.Ullash.com.bd blog posts. Ullash only discloses logged in user and commenter IP addresses under the same circumstances that it uses and discloses personally-identifying information as described below.</p>\r\n<p><strong>2. Personally-Identifying Information</strong></p>\r\n<p style=\"text-align: justify;\">Certain visitors to Ullash\'s websites choose to interact with Ullash in ways that require Ullash to gather personally-identifying information. The amount and type of information that Ullash gathers depends on the nature of the interaction. For example, we ask visitors who leave a comment at <a href=\"https://www.ullash.com.bd\">https://www.ullash.com.bd</a> to provide a username and email address.</p>\r\n<p><strong>3. Security</strong></p>\r\n<p style=\"text-align: justify;\">The security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</p>\r\n<p><strong>4. Advertisements</strong></p>\r\n<p style=\"text-align: justify;\">Ads appearing on our website may be delivered to users by advertising partners, who may set cookies. These cookies allow the ad server to recognize your computer each time they send you an online advertisement to compile information about you or others who use your computer. This information allows ad networks to, among other things, deliver targeted advertisements that they believe will be of most interest to you. This Privacy Policy covers the use of cookies by Ullash and does not cover the use of cookies by any advertisers.</p>\r\n<p><strong>5. Ullash uses Google AdWords for remarketing</strong></p>\r\n<p style=\"text-align: justify;\">Ullash uses the remarketing services to advertise on third party websites (including Google) to previous visitors to our site. It could mean that we advertise to previous visitors who haven\'t completed a task on our site, for example using the contact form to make an enquiry. This could be in the form of an advertisement on the Google search results page, or a site in the Google Display Network. Third-party vendors, including Google, use cookies to serve ads based on someone\'s past visits. Of course, any data collected will be used in accordance with our own privacy policy and Google\'s privacy policy.</p>\r\n<p style=\"text-align: justify;\">You can set preferences for how Google advertises to you using the Google Ad Preferences page, and if you want to you can opt out of interest-based advertising entirely by cookie settings or permanently using a browser plugin.</p>\r\n<p><strong>6. Protection of Certain Personally-Identifying Information</strong></p>\r\n<p style=\"text-align: justify;\">Ullash discloses potentially personally-identifying and personally-identifying information only to those of its employees, contractors and affiliated organizations that (i) need to know that information in order to process it on Ullash\'s behalf or to provide services available at Ullash\'s website, and (ii) that have agreed not to disclose it to others. Some of those employees, contractors and affiliated organizations may be located outside of your home country; by using Ullash\'s website, you consent to the transfer of such information to them. Ullash will not rent or sell potentially personally-identifying and personally-identifying information to anyone. Other than to its employees, contractors and affiliated organizations, as described above, Ullash discloses potentially personally-identifying and personally-identifying information only in response to a subpoena, court order or other governmental request, or when Ullash believes in good faith that disclosure is reasonably necessary to protect the property or rights of Ullash, third parties or the public at large.</p>\r\n<p style=\"text-align: justify;\">If you are a registered user of https://www.Ullash.com.bd and have supplied your email address, Ullash may occasionally send you an email to tell you about new features, solicit your feedback, or just keep you up to date with what\'s going on with Ullash and our products. We primarily use our blog to communicate this type of information, so we expect to keep this type of email to a minimum. If you send us a request (for example via a support email or via one of our feedback mechanisms), we reserve the right to publish it in order to help us clarify or respond to your request or to help us support other users. Ullash takes all measures reasonably necessary to protect against the unauthorized access, use, alteration or destruction of potentially personally-identifying and personally-identifying information.</p>\r\n<p><strong>7. Aggregated Statistics</strong></p>\r\n<p style=\"text-align: justify;\">Ullash may collect statistics about the behavior of visitors to its website. Ullash may display this information publicly or provide it to others. However, Ullash does not disclose your personally-identifying information.</p>\r\n<p><strong>8. Affiliate Disclosure</strong></p>\r\n<p style=\"text-align: justify;\">This site uses affiliate links and does earn a commission from certain links. This does not affect your purchases or the price you may pay.</p>\r\n<p><strong>9. Cookies</strong></p>\r\n<p style=\"text-align: justify;\">To enrich and perfect your online experience, Ullash uses \"Cookies\", similar technologies and services provided by others to display personalized content, appropriate advertising and store your preferences on your computer.</p>\r\n<p style=\"text-align: justify;\">A cookie is a string of information that a website stores on a visitor\'s computer, and that the visitor\'s browser provides to the website each time the visitor returns. Ullash uses cookies to help Ullash identify and track visitors, their usage of https://www.Ullash.com.bd, and their website access preferences. Ullash visitors who do not wish to have cookies placed on their computers should set their browsers to refuse cookies before using Ullash\'s websites, with the drawback that certain features of Ullash\'s websites may not function properly without the aid of cookies.</p>\r\n<p style=\"text-align: justify;\">By continuing to navigate our website without changing your cookie settings, you hereby acknowledge and agree to Ullash\'s use of cookies.</p>\r\n<p style=\"text-align: justify;\"><strong>10. E-commerce</strong></p>\r\n<p style=\"text-align: justify;\">Those who engage in transactions with Ullash &ndash; by purchasing Ullash\'s services or products, are asked to provide additional information, including as necessary the personal and financial information required to process those transactions. In each case, Ullash collects such information only insofar as is necessary or appropriate to fulfill the purpose of the visitor\'s interaction with Ullash. Ullash does not disclose personally-identifying information other than as described below. And visitors can always refuse to supply personally-identifying information, with the caveat that it may prevent them from engaging in certain website-related activities.</p>\r\n<p><strong>11. Privacy Policy Changes</strong></p>\r\n<p style=\"text-align: justify;\">Although most changes are likely to be minor, Ullash may change its Privacy Policy from time to time, and in Ullash\'s sole discretion. Ullash encourages visitors to frequently check this page for any changes to its Privacy Policy. Your continued use of this site after any change in this Privacy Policy will constitute your acceptance of such change.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-09-27 11:02:06', '2023-03-20 09:21:23'),
(6, 'Term and Conditions', '<p><strong>Replacements Refunds</strong></p>\r\n<p>All replacement requests must be made within 48 hours of order receipt, by contacting our customer care team at&nbsp;info@zamzamtradingbd.com. Once the request has been received and approved, the replacement item(s) will be shipped within 2-7 working days.</p>\r\n<ul>\r\n<li>The product has been damaged during delivery</li>\r\n<li>The product is defective or out of date</li>\r\n<li>The incorrect product was shipped</li>\r\n</ul>\r\n<p><strong>To return items ordered </strong></p>\r\n<ul>\r\n<li>If you return or replace a product, you will be entitled to a product worth the same amount or the same amount of money as you are returning the product.</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong><strong>Get your money back:</strong></p>\r\n<ul>\r\n<li>We need 5-7 business days to refund the money to your account. If you purchase the product at an offer price, your refund/ replacement/ adjustment will be based on that offer price.</li>\r\n<li>Where you use multiple payment methods for products and services, and you return some of the products in your order, refunds will be made in the following order:</li>\r\n</ul>\r\n<ol>\r\n<li>If purchased directly from the outlet &ndash; Cash</li>\r\n<li>If you have purchased online / through Customer Care &ndash; Mobile Banking Portal (Bkash/ Cash)</li>\r\n</ol>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-09-27 11:02:06', '2021-12-06 02:12:15'),
