(8, 'B2B', '<p style=\"text-align: justify;\">&nbsp;</p>\r\n<hr />\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">বাংলাদেশের অন্যতম আমদানিকারক হিসেবে জমজম ট্রেডিং বিডি সকলের কাছে সমাদৃত। সৌদি আরব থেকে প্রিমিয়াম মানের খেজুর আমদানিতে ইতোমধ্যেই জমজম ট্রেডিং বিডি বিশেষ সুনাম অর্জন করেছে। সৌদি আরবের প্রিমিয়াম মানের খেজুর পৃথিবীর অন্যতম সেরা খেজুর। স্বাদে এবং মানে এর তুলনা হয় </span><span style=\"font-size: 14pt;\">না।&nbsp;</span><span style=\"font-size: 14pt;\">যে সকল খেজুর আমরা আমদানি করছি তার প্রধান কয়েকটির নাম উল্লেখ করা হলো- আজওয়া, মাবরুম, সাফাউই বা কলমি, সুক্কারি, সুগাই, মাশরুক, মেজদুল, আম্বর ইত্যাদি অন্যতম।&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">বাংলাদেশে দিন দিন খেজুরের চাহিদা অবিশ্বাস্যভাবে বেড়ে চলেছে। খাদ্যগুণ এবং পুষ্টি বিবেচনায় খেজুরের বিকল্প নেই। তাই আমাদের নিকট থেকে খেজুর নিয়ে অনেকেই খুচরা ব্যবসা করে সফলতার মুখ দেখেছেন। আমাদের সাথে যারা ব্যবসা করতে আগ্রহী তাদের জন্য আমরা সব সময়ই বিশেষ সহযোগীতার মনোভাব রয়েছে। আপনি যদি ছোট কিংবা বড় যে কোন পরিসরেই খেজুরসহ অন্যান্য আমদানিকৃত পণ্যের ব্যবসা করতে চান তাদের জন্য বিশেষ সুযোগ প্রদান করছে জমজম ট্রেডিং বিডি।&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #e03e2d; font-size: 18pt;\"><strong>পাইকারী ও খুচরা ব্যবসায়ী হিসেবে আমাদের কাছ থেকে খেজুর সংগ্রহ করতে চান?</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">খেজুর ব্যবসায়ী হিসেবে প্রতিষ্ঠিত হতে চান এমন ব্যবসায়ী ভাইদের জন্য আমরা পাইকারী কিংবা আমদানিকৃত মূল্যে খেজুর প্রদান করতে পারি। ক্ষেত্র বিশেষে অনেকেই আমদানির ঝামেলা এড়িয়ে লোকাল মার্কেটে ব্যবসা করতে চান। তাদের জন্য আমাদের রয়েছে বিশেষ সহযোগীতা। চাইলে আপনি পুরো কন্টেইনার কিংবা আংশিক কন্টেইনার কিংবা নির্দিষ্ট পরিমান খেজুর বিশেষ মূ্ল্যে সংগ্রহ করতে পারেন। এ ব্যাপারে বিস্তারিত জানার জন্য আমাদের সাথে সরাসরি কথা বলতে পারেন অথবা যোগাযোগ ফরমে বিস্তারিত জানিয়ে আমাদেরকে ই-মেইল করতে পারেন। 48 ঘণ্টার মধ্যেই আপনার যোগাযোগ করার আন্তরিক চেষ্টা করা হবে ইনশাআল্লাহ।&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #e03e2d; font-size: 14pt;\"><strong>অনলাইন ব্যবসায়ীদের জন্য বিশেষ সাপোর্ট</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">যারা ক্ষুদ্র পরিসরে অনলাইন প্লাটফর্মের মাধ্যমে ব্যবসা করছেন তাদের জন্য চমৎকার একটি সাপোর্ট রয়েছে আমাদের ওয়্যারহাউসের পক্ষ থেকে। স্বল্প বিনিয়োগে বেশি লাভ - এ ভিত্তিতে কাজ করছে আমাদের অনলাইন মার্কেটিং টিম। আপনার প্রয়োজনীয় সেবার জন্য আজই যোগাযোগ করুন।&nbsp;</span></p>', NULL, NULL, NULL, '1631706673.png', NULL, NULL, NULL, '2021-11-03 05:37:13', '2021-12-15 19:12:39');
