(57, 1, 'Medjool Super Premium 1kg', '1', 1, 23, 1200, 1000, 1, NULL, 'J24M5I', 'kg', NULL, NULL, 1, 'single', NULL, NULL, 'images/product/1643279224.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p style=\"text-align: justify;\">Majdool was known as the Queen of dates, These dates are naturally sweet without any added sugar and they are full of potassium. Majdool dates are high in calcium and iron, one serving of dates also provides you with 20% of your daily dietary fiber. considering the high level of sweetness in majdool dates, diabetic patients try to avoid it nevertheless they are one of the best dates to eat.</p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ba372a; font-size: 14pt;\"><strong>Dates are super power healthy</strong></span></p>\r\n<p style=\"text-align: justify;\">Aside from the delicious taste, they impart a tremendous amount of benefits to your body. They are a rich source of healthy fiber, minerals, and vitamins and help with constipation, diarrhea, and other intestinal complaints. If you add three to seven dates a day to your diet, the following 10 things will happen to your body.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>View</strong></span>:&nbsp; Healthy for the eyes and vision and reduces night blindness.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Digestion:</strong></span>&nbsp; Rich source of fiber and minerals help with constipation, diarrhea, and other intestinal complaints.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Cancer:</strong></span>&nbsp;Prevents cancer risk, dates contain magnesium, manganese and selenium.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Nervous system:</strong></span>&nbsp; Stimulates the health of the nervous system.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Bones:&nbsp;</strong></span> Minerals present to strengthen the bones.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Allergies:</strong></span>&nbsp;Presence of sulfur decreases.&nbsp;Allergic reactions.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Weight loss:</strong></span>&nbsp; The many dietary fibers in dates ensure a long, full feeling.&nbsp;Dates are low in calories and fat.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Heart:</strong></span>&nbsp;Dates fight calcium in blood vessels, lower the risk of strokes, heart attacks, etc.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Energy:</strong></span>&nbsp;The ideal snack after exercise, gives an energy boost and is easy to digest, source of iron, helps with anemia.</p>\r\n<p><span style=\"color: #ba372a;\"><strong>Pregnancy:&nbsp;</strong></span> Dates are particularly healthy during pregnancy and breastfeeding as they contain folic acid</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<p><strong>The detailed specifications of Medjool Super Premium is shown in the table below:</strong></p>\r\n<p>&nbsp;</p>\r\n<table width=\"505\">\r\n<tbody>\r\n<tr>\r\n<td width=\"155\">\r\n<p>Product name</p>\r\n</td>\r\n<td width=\"350\">\r\n<p>Medjool Super Premium</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"155\">\r\n<p>Brand Name</p>\r\n</td>\r\n<td width=\"350\">\r\n<p>ZamZam Premium Dates</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"155\">\r\n<p>Country of Origin</p>\r\n</td>\r\n<td width=\"350\">\r\n<p>Saudi Arabia</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"155\">\r\n<p>Product Collect from</p>\r\n</td>\r\n<td width=\"350\">Madinah Al Monwara <strong>WE DIRECTLY COLLECTED FROM GARDEN</strong></td>\r\n</tr>\r\n<tr>\r\n<td width=\"155\">\r\n<p>Quality</p>\r\n</td>\r\n<td width=\"