(291, 1, 'Combo pack of five flavored dates', '1', 1, 12, 1890, 1450, 1, NULL, 'MR1QR5', 'kg', NULL, NULL, 3, 'single', NULL, NULL, 'images/product/1644155796.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>পাঁচ স্বাদের পাঁচ খেজুর এখন পাচ্ছেন এক সাথে, খেজুরের স্বাদের এক্সপেরিমেন্ট চলবে পুরো দমে</p>\r\n<p>কম্বো প্যাকেজে রয়েছে:-<br />👉 আজওয়া রেগুলার (মদিনাতুল মনোয়ারা)<br />👉 সুক্কারি (আল কাসিম)<br />👉 মাবররুম/মরিয়াম (আলউলা)<br />👉 সাফওয়াই/কলমি &nbsp;(মদিনাতুল মনোয়ারা)<br />👉 সালাভিয়া (রিয়াদ)</p>\r\n<p>𝐏𝐚𝐜𝐤𝐢𝐧𝐠 𝐃𝐚𝐭𝐞: 03-10-2021<br />𝐄𝐱𝐩 𝐃𝐚𝐭𝐞: 02-10-2023&nbsp;</p>\r\n<p>𝐀𝐣𝐰𝐚: আজওয়া রেগুলারের প্রতিটি খেজুরের ওজন: ৬-১০ গ্রাম। খেজুরের মধ্যে এই খেজুরটি অত্যান্ত বরকতময় হওয়ার কারণে আমরা এখানে এর পরিমান দিয়েছি ১কেজি! আর বাকি খেজুর গুলো পরিমাণে হাফ কেজি করে।&nbsp;</p>\r\n<p>𝐒𝐮𝐤𝐤𝐚𝐫𝐢: প্রিমিয়াম সাইজ সুক্কারি খেজুরটি আরববাসীদের পছন্দের শীর্ষে থাকা একটি খেজুর। এর স্বাদের সুমিষ্টতার জন্য একে খেজুরের রানী বলা হয়ে থাকে। প্রতিটি খেজুরের ওজন: ১০-১২ গ্রাম</p>\r\n<p>𝐌𝐚𝐬𝐡𝐫𝐮𝐤: প্রিমিয়াম সাইজের এই খেজুরটি মাবরুম খেজুরের আরেকটি জাত। এর স্বাদ, ঘ্রান ও মিষ্টতা মাবরুম খেজুরের মতোই। বাংলাদেশে এটি মরিয়াম নামে পরিচিত। প্রতিটি খেজুরের ওজন: ১০-১৫ গ্রাম</p>\r\n<p>𝐊𝐚𝐥𝐦𝐢: সাফওয়াই বা কলমি রেগুলার খেজুরটি লালচে কালো বর্ণের একটি সুমিষ্ট খেজুর যার স্বাদ অনেকটাই &nbsp;চকলেটের মতো। &nbsp;প্রতিটি খেজুরের ওজন: ৬-১০ গ্রাম</p>\r\n<p>𝐒𝐚𝐥𝐚𝐯𝐢𝐚: এই খেজুরটি টাটকা লালচে বর্ণের একটি চমৎকার খেজুর। এর স্বাদ ও ঘ্রান অন্য সকল খেজুরের থেকে ভিন্ন এবং ওজনে হালকা হয়ে থাকে। প্রতিটি খেজুরের ওজন: ৬-১০ গ্রাম</p>\r\n<p>𝐏𝐚𝐜𝐤𝐚𝐠𝐢𝐧𝐠: এই সবগুলো খেজুর মদিনা থেকে ৩কেজি ইন্টাক্ট বক্সে বাংলাদেশে এসেছে। আপনাদের কম্বো প্যাকেজের প্রতি অধিক আগ্রহের ভিত্তিতে আমরা নিজস্ব তত্ত্ববোধনে স্বাস্থকর ও অত্যান্ত সতর্কতা পক্রিয়া অবলম্বন করে এটি তৈরী করেছি।</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-01-20 01:48:24', '2022-09-14 22:59:00'),
