(295, 1, 'Dried Figs- 500gm', '4', 5, NULL, 795, 599, 1, NULL, 'IUICDP', 'gm', NULL, NULL, 500, 'single', '94', NULL, 'images/product/1644471134.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>আশ্চযর্জনক ও বিস্ময়কর ফল ডুমুর বা ত্বীন ফল। স্বয়ং সৃষ্টিকতার পবিত্র কোরআনে যার বণর্না করেছেন।</p>\r\n<p>ত্বীন ফলের উল্লেখ আছে পবিত্র কোরআনের সুরা ত্বীনে। এই বরকতময় ফলের নামেই নামকরণ করা হয়েছে এই সুরার।</p>\r\n<ul>\r\n<li>কেন খাবেন ত্বীন ফলঃ</li>\r\n<li>যৌন ক্ষমতা বৃদ্ধি করে</li>\r\n<li>কোলেস্টেরলের মাত্রা হ্রাস করে</li>\r\n<li>হজমে সাহায্য করে ত্বকের সৌন্দর্যে বাড়ায়&nbsp;</li>\r\n<li>হাড়ের রক্ষণাবেক্ষণ এবং দৃষ্টিশক্তি বাড়ায়</li>\r\n<li>ফাইবার সমৃদ্ধ ত্বীন ফল খাদ্য তালিকায় রাখার ফলে ৩৪% নারীর মধ্যে ক্যানসার হওয়ার সম্ভাবনা কম দেখা গিয়েছে</li>\r\n</ul>\r\n<p><strong>সরাসরি তুরস্ক থেকে আমদানিকৃত প্রিমিয়াম কোয়ালটির ত্বীন ফল।&nbsp;</strong></p>\r\n<p>𝐏𝐚𝐜𝐤𝐢𝐧𝐠 𝐃𝐚𝐭𝐞: 17-01-2022<br />𝐄𝐱𝐩 𝐃𝐚𝐭𝐞: 17-01-2023</p>\r\n<p>𝐙𝐚𝐦𝐳𝐚𝐦 𝐓𝐫𝐚𝐝𝐢𝐧𝐠 &nbsp;𝐁𝐃 সরাসরি প্রিমিয়াম মানের প্রোডাক্ট আমদানি করে ফলে আমাদের পণ্যগুলো সর্বোচ্চ গুনগত মানের।</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-02-09 01:19:35', '2022-09-14 00:26:04'),
(296, 1, 'Palermo Extra Virgin Olive Oil 500ml', '6', 7, 40, 600, 550, 1, NULL, 'S21LWQ', 'ml', NULL, NULL, 500, 'single', '9', NULL, 'images/product/1645358344.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>অলিভ অয়েলে আছে এন্টিঅক্সিডেন্ট, ভিটামিন ই, কে। এই এন্টিঅক্সিডেন্ট অকালে বুড়িয়ে যাওয়া রোধ করে। ত্বকের যত্নে ভিটামিন ই বেশ কার্যকর ভূমিকা রাখে। নিয়মিত অলিভ অয়েল ব্যবহারে ত্বক হয় আকর্ষণীয়। আপনার যদি মুখে ব্রণ ওঠার সমস্যা থাকে, তাহলে অলিভ অয়েল ব্যবহার শুরু করতে পারেন। এই ভিটামিন ই কিন্তু চুলের জন্যও বেশ উপকারী।</p>\r\n<p>দেহে কার্বোহাইড্রেট বা শর্করার মাত্রা নিয়ন্ত্রণে না থাকলে আমাদের মাঝে ডায়াবেটিস দেখা দেয়। শর্করার মাত্রা নিয়ন্ত্রণে রেখে দেহে ডায়াবেটিসও নিয়ন্ত্রণে রাখে অলিভ অয়েল। মুটিয়ে যাচ্ছেন? আয়নার সামনে নিজেকে দেখতেই খারাপ লাগছে? অলিভ ওয়েলে থাকা মনো স্যাচুরেটেড ফ্যাট আর অ্যাডিপন্সটিন নামক প্রোটিন দেহ থেকে অতিরিক্ত চর্বি বের করে দিবে। ফলে আপনি হবেন অনেকটাই মেদমুক্ত। যারা অতিরিক্ত মোটা হয়ে গেছেন তারা রান্নায় সয়াবিন তেল বাদ দিয়ে অলিভ অয়েল ব্যবহার করে দেখতে পারেন।&nbsp;</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-02-20 05:59:04', '2022-09-14 00:25:44'),
