(365, 1, 'Zam Zam water (Holy Water)- 5 Liter', NULL, 7, NULL, 4500, 3999, 1, NULL, 'MOU4GM', 'ltr', NULL, NULL, 5, 'single', '148', NULL, 'images/product/1655642984.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">পৃথিবী সেরা পানি জমজম। এ পানির সঙ্গে জড়িয়ে আছে নবী ইসমাইল (আ.) এর আলাইহিস সালাম এর স্মৃতিবিজড়িত ইতিহাস। আমাদের প্রিয়নবী সাল্লাল্লাহু আলাই সাল্লাম এর কাছেও ছিল এ পানি বরকতময় ও ফজিলতপূর্ণ।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">জাবির (রা.) বর্ণনা করেন, রাসূলুল্লাহ (সা.) বলেছেন, &lsquo;জমজমের পানি যে উদ্দেশ্য নিয়ে পান করবে তা পূরণ হবে।&rsquo; (সুনানে ইবনে মাজাহ, হাদিস : ৩০৬২)</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">হজরত আবদুল্লাহ ইবনে আব্বাস (রা.) বলেন, &lsquo;রাসুল (সা.) বলেছেন, পৃথিবীর সর্বোত্তম পানি হচ্ছে জমজমের পানি।\'</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">আয়েশা (রা.) বর্ণনা করেন, রাসূলুল্লাহ (সা.) নিজের সঙ্গে পাত্রে ও মশকে করে জমজমের পানি বহন করতেন। তা অসুস্থদের ওপর ছিটিয়ে দিতেন এবং তাদের পান করাতেন। (সুনানে তিরমিজি) ।</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n</div>\r\n<div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\">\r\n<div dir=\"auto\">আলহামদুলিল্লাহ Zamzam Trading BD আপনাদের সেবার উদ্দেশে কিছু জমজম কুপের পানি সংগ্রহ করেছে- স্টক সীমিত</div>\r\n<div dir=\"auto\">\r\n<p>জম জমের পানি ইম্পোর্ট করতে বিমান খরচ ও সরকারি ভেট,টেক্স &nbsp; ও &nbsp;অন্যান্য খরচ &nbsp;অনেক বেশি দিতে হয়, সেইজন্যে জমমজমের পানির দাম বাংলাদেশে তুলনামেীলক ভাবে বেশি হয়ে থাকে&nbsp;</p>\r\n</div>\r\n</div>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Tradi