(369, 1, 'Cow & Gate Stage 01 - 800gm', '6', 6, NULL, 2450, NULL, 0, NULL, '1QLDEL', 'gm', NULL, NULL, 800, 'single', '15', NULL, 'images/product/1655706837.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<ul>\r\n<li>For babies aged 0 to 6 months</li>\r\n<li>Nutritionally complete breast milk substitute</li>\r\n<li>No:1 UK Baby Milk Powder</li>\r\n<li>Highly suggested &amp; recommended by Doctors</li>\r\n<li>Nutritionally complete breast milk substitute</li>\r\n<li>No added colours or flavours</li>\r\n<li>No added sugar or salt</li>\r\n<li>High in vitamin D</li>\r\n<li>Enriched with Iron</li>\r\n<li>Source of Calcium</li>\r\n</ul>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 00:33:57', '2022-09-13 00:42:13'),
(370, 1, 'Cow & Gate 2 Follow On Baby Milk Formula 800g', NULL, 6, NULL, 2890, NULL, 0, NULL, '4AHWHZ', 'gm', NULL, NULL, 800, 'single', '50', NULL, 'images/product/1655707308.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>When it comes to looking after your little one, support care and nutrition all help. Did you know that from 6 months old your baby needs more iron in their diet? Our follow-on milk can lend a helping hand to support your little one&rsquo;s nutritional needs as part of a varied, balanced diet, right up until they turn 1 year old.</p>\r\n<ul>\r\n<li>Vitamin D &amp; Calcium for normal bone development.</li>\r\n<li>Iron to support normal cognitive development.</li>\r\n<li>Complement a weaning diet</li>\r\n</ul>\r\n<p><strong>Ingredients: </strong></p>\r\n<p>Lactose (from Milk), Skimmed Milk, Vegetable Oils (Palm Oil, Rapeseed Oil, Coconut Oil, Sunflower Oil), Galacto-Oligosaccharides (GOS) (from Milk), Fructo-Oligossacharides (FOS), Calcium Carbonate, Potassium Chloride, Vitamin C, Choline Chloride, Taurine, Emulsifier (Soy Lecithin), Iron Sulphate, L-Tryptophan, Inositol, Vitamin E, L-Isoleucine, Uridine 5&prime;-Monophosphate Sodium Salt, Zinc Sulphate, Cytidine 5&prime;-Monophoshate, L-Cysteine Hydrochloride, Adenosine 5&prime;-Monophoshapte, Inosine 5&prime;-Monophosphate Sodium Salt, Niacin, Guanosine 5&prime;-Monophosphate Sodium Salt, L-Carnitine, Pantothenic Acid, Folic Acid, Copper Sulphate, Vitamin A, Biotin, Thiamin, Vitamin D3, Vitamin B12, Vitamin B6, Manganese Sulphate, Potassium Iodide, Vitamin K1, Sodium Selenite</p>\r\n<p>Allergy Advice &ndash; For allergens, see ingredients in bold</p>\r\n<p>Milk<br />Soy</p>\r\n<p>Nutritional Information per 100ml prepared feed<br />Units (% LRV&dagger;)<br />Energy 285 kJ<br />68 kcal<br />Fat 3 g &amp;<br />of which, saturates 1.3 g<br />Carbohydrate 8.6 g<br />of which, sugars 8.5 g<br />of which, lactose 8.3 g<br />Fibre 0.6 g<br />Protein 1.4 g<br />Salt 0.04 g<br />Vitamins<br />Vitamin A 67 &micro;g RE (17%)<br />Vitamin D3 1.5 &micro;g (21%)<br />Vitamin E 1.2 mg &alpha;-TE (24%)<br />Vitamin K1 5.1 &micro;g (43%)<br />Vitamin C 9.5 mg (21%)<br />Thiamin (B1) 0.06 mg (11%)<br />Riboflavin (B2) 0.09 mg (13%)<br />Niacin (B3) 0.45 mg (6%)<br />Pantothenic acid 0.35 mg (12%)<br />Vitamin B6 0.04 mg (6%)<br />Folic acid 12 &micro;g (10%)<br />Vitamin B12 0.13 &micro;g (16%)<br />Biotin 1.5 &micro;g (15%)<br />Minerals<br />Sodium 17 mg (4%)<br />Potassium 77 mg (8%)<br />Chloride 54 mg (11%)<br />Calcium 68 mg (12%)<br />Phosphorus 37 mg (7%)<br />Magnesium 4.5 mg (6%)<br />Iron 1 mg (13%)<br />Zinc 0.57 mg (11%)<br />Copper 0.041 mg (8%)<br />Manganese 0.007 mg (1%)<br />Fluoride &le;0.003 mg<br />Selenium 1.6 &micro;g (8%)<br />Iodine 13 &micro;g (16%)<br />Others<br />Choline 10 mg<br />Taurine 5.3 mg<br />Inositol 3.7 mg<br />L-carnitine 0.95 mg<br />Nucleotides 3.2 mg<br />GOS/FOS* 0.8 g<br />&dagger;%Labelling Reference Value<br />*Galacto- &amp; Fructo- Oligosaccharides.</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<p>Country of origin: UK</p>\r\n<p>Manufacturers address: Nutricia Ltd, White Horse Business Park, Trowbridge, Wiltshire, BA14 0XB.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 00:41:48', '2022-09-13 00:41:37'),
(371, 1, 'Aptamil Creamed Apricot Porridge 4-6+ Months 125g', NULL, 6, NULL, 650, NULL, 0, NULL, 'S5CVTM', 'gm', NULL, NULL, 125, 'single', '150', NULL, 'images/product/1655707746.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>Making the right feeding choices for you and your baby. We&rsquo;ve been pioneering research into infant and toddler nutrition for over 50 years to help you give your baby the best start in life. We ensure only high quality grains and fruit are selected and then combine these with our unique blend of nutrients, Pronutravi+&trade;. Offering your baby a wide variety of foods along their weaning journey is important as this is when they start to form their taste preferences. Our range of unique cereals are specifically developed to introduce delicious tastes and textures as your baby progresses.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How to use:</strong></p>\r\n<p>To Serve</p>\r\n<p>Using a clean bowl and feeding spoon. Mix 1 spoonful of cereal with. 2 1/2 spoonfuls of warm, previously boiled water and stir. If serving warm, check temperature before feeding. As your baby&rsquo;s appetite grows use a larger spoon to make a bigger serving. This is only a guide, if you want to alter the consistency, add more or less water as required. Smooth textures are best when your baby starts weaning because they&rsquo;re easy for your baby to manage.</p>\r\n<p>Storage</p>\r\n<p>Please store this product in a cool dry place (not in the fridge) and once opened use within 28 days. Packaged in a protective atmosphere.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Hazards and Cautions</strong></p>\r\n<p><br />Do not leave your baby alone whilst feeding. Remember to clean your baby&rsquo;s teeth, especially before bedtime.</p>\r\n<p>While every care has been taken to ensure this information is always as accurate as possible, food products are regularly improved and nutrition content may occasionally change. As a result we recommend that you always read the label carefully before using or consuming any products.</p>\r\n<p>Nutritional Reference Value (NRV) information is based on the typical composition of the product. Guideline daily amounts are those for a typical adult (men and women).</p>\r\n<p>NRV information for non Boots products is calculated by the manufacturer. Boots has no control over the recipe or nutritional content of such products and information on this site may differ to that given on the product label. We would therefore recommend you do not solely rely on this information and always read the product label.</p>\r\n<p>If you have any queries, or you would like advice on Boots products please contact our friendly Customer care team on 0345 609 0055.</p>\r\n<p>This information was last updated 12/09/2014</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Ingredients:</strong></p>\r\n<p>Fortified Milk (55%) [Demineralised Whey Powder (from Milk), Skimmed Milk Powder, Vegetable Fat (contains Soy Lecithin), Calcium, Vitamins (Vitamin C, Niacin, Pantothenic Acid, Vitamin E, Vitamin B1, Vitamin B6, Vitamin A, Folic Acid, Vitamin K1, Vitamin D3, Biotin, Vitamin B12), Iron, Zinc, Copper, Potassium], Milled Cereals [Corn (14%), Rice (14%)], Banana (8%), Apricot (6%), Dietary Fibre [Galacto-Oligosaccharides (GOS) (from Milk), Fructo-Oligosaccharides (FOS)]</p>\r\n<p>Prepared with 100g dry product</p>\r\n<p>Allergy advice &ndash; For allergens, see ingredients in bold</p>\r\n<p>Milk</p>\r\n<p>Soya</p>\r\n<p>Nutrition Information</p>\r\n<p>Typical values per 100g powder</p>\r\n<p>Energy (kJ) 1770</p>\r\n<p>(kcal) 420</p>\r\n<p>Fat (g) 10.4</p>\r\n<p>of which saturates (g) 5</p>\r\n<p>Carbohydrates (g) 67.4</p>\r\n<p>of which sugars* (g) 43.7</p>\r\n<p>Protein (g) 11.9</p>\r\n<p>Fibre (g) 4.8</p>\r\n<p>Salt* (g) 0.3</p>\r\n<p>Vitamins</p>\r\n<p>Vitamin A (&micro;g-RE) 429</p>\r\n<p>Vitamin D3 (&micro;g) 9</p>\r\n<p>Vitamin E (mg a-TE) 2.4</p>\r\n<p>Vitamin K1 (&micro;g) 13</p>\r\n<p>Vitamin C (mg) 52</p>\r\n<p>Thiamin (B1) (mg) 0.8</p>