mins and minerals needed per day to meet the requirements of infants and young children</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<p><strong>Important info:</strong><br />With our unique blend of ingredients<br />Just add warm water<br />Smooth texture<br />Ideal for first weaning<br />Gluten free<br />No added salt or sugar &ndash; contains only naturally occurring sugars and sodium<br />No preservatives<br />Country of origin &ndash; Produce of the EU</p>\r\n<p>Name and address of manufacturer &ndash; Nutricia Ltd, White Horse Business Park, Trowbridge, Wiltshire, BA14 0XB.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 00:59:05', '2022-09-13 00:40:13'),
(374, 1, 'Aptamil Multigrain Cereal 200G 7 Month Plus', NULL, 6, NULL, 2290, NULL, 0, NULL, 'MEVY2H', 'gm', NULL, NULL, 200, 'single', '150', NULL, 'images/product/1655708890.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<div id=\"product-description\" class=\"product-info-block product-info-block--product-description \">\r\n<ul class=\"product-info-block__content\">\r\n<li class=\"product-info-block__content-item\">Multigrain cereal with milk for babies from 7+months.</li>\r\n<li class=\"product-info-block__content-item\">Visit us at www.aptaclub.co.uk to see our full range.</li>\r\n</ul>\r\n</div>\r\n<div id=\"product-marketing\" class=\"product-info-block product-info-block--product-marketing \">\r\n<ul class=\"product-info-block__content\">\r\n<li class=\"product-info-block__content-item\">Making the right feeding choices for you and your baby</li>\r\n<li class=\"product-info-block__content-item\">We&rsquo;ve been pioneering research into infant and toddler nutrition for over 40 years to help you give your baby the best start in life. We ensure only high quality grains and fruit are selected and then combine these with our unique blend of ingredients, Pronutravit+&trade;.</li>\r\n<li class=\"product-info-block__content-item\">Pronutravi+&trade; our unique blend of ingredients</li>\r\n<li class=\"product-info-block__content-item\">GOS/FOS &ndash; Our unique patented blend of galacto- and fructo-oligosaccharides.</li>\r\n<li class=\"product-info-block__content-item\">Iron &ndash; To support normal cognitive development</li>\r\n<li class=\"product-info-block__content-item\">Vitamins A, C and D &ndash; Vitamin D for normal development of bones.</li>\r\n<li class=\"product-info-block__content-item\">Taste &ndash; simple, exploring and adventurous</li>\r\n<li class=\"product-info-block__content-item\">Texture &ndash; smooth, thicker and varied</li>\r\n</ul>\r\n</div>\r\n<div id=\"brand-marketing\" class=\"product-info-block product-info-block--brand-marketing \">\r\n<ul class=\"product-info-block__content\">\r\n<li class=\"product-info-block__content-item\">Nutricia Bringing Science to Early Life</li>\r\n<li class=\"product-info-block__content-item\">Offering your baby a wide variety of foods along their weaning journey is important as they start to form their taste preferences. Our unique range of cereals for 7+ months are specially developed to introduce delicious tastes and a thicker texture as your baby progresses.</li>\r\n<li class=\"product-info-block__content-item\">Creamed Porridge</li>\r\n<li class=\"product-info-block__content-item\">4-6+ months &ndash; Simple taste, Smooth texture</li>\r\n<li class=\"product-info-block__content-item\">Multigrain &amp; Berry Cereal</li>\r\n<li class=\"product-info-block__content-item\">7+ Months &ndash; Exploring taste, Thicker texture</li>\r\n<li class=\"product-info-block__content-item\">Oats, Apple &amp; Plum Muesli</li>\r\n<li class=\"product-info-block__content-item\">10+ Months &ndash; Adventurous taste, Varied texture</li>\r\n</ul>\r\n</div>\r\n<div id=\"other-information\" class=\"product-info-block product-info-block--other-information \">\r\n<ul class=\"product-info-block__content\">\r\n<li class=\"product-info-block__content-item\">Packaged in a protective atmosphere.</li>\r\n<li class=\"product-info-block__content-item\">Contents may settle in transit.</li>\r\n<li class=\"product-info-block__content-item\">With our unique blend of ingredients</li>\r\n</ul>\r\n</div>\r\n<div id=\"features\" class=\"product-info-block product-info-block--features \">\r\n<ul class=\"product-info-block__content\">\r\n<li class=\"product-info-block__content-item\">Thicker texture</li>\r\n<li class=\"product-info-block__content-item\">Natural wholegrains</li>\r\n<li class=\"product-info-block__content-item\">Just add warm water</li>\r\n<li class=\"product-info-block__content-item\">No added salt or sugar &ndash; contains naturally occurring sugars and salt only</li>\r\n<li class=\"product-info-block__content-item\">No preservatives</li>\r\n<li class=\"product-info-block__content-item\">Pack size: 200G</li>\r\n<li class=\"product-info-block__content-item\">Iron &ndash; To support normal cognitive development</li>\r\n<li class=\"product-info-block__content-item\">Vitamins A, C and D &ndash; Vitamin D for normal development of bones</li>\r\n<li class=\"product-info-block__content-item\">No added salt or sugar</li>\r\n</ul>\r\n</div>\r\n<p><strong>Ingredients:</strong><br />Demineralised Whey Powder (32%) (from Milk), Milled Cereals (30%) [Wholegrain Wheat (21%) (contains Gluten), Rice (4%), Wholegrain Oats (2%) (contains Gluten), Wholegrain Millet (2%)], Skimmed Milk Powder (20%), Vegetable Fat (Palm Oil, Rapeseed Oil, Coconut Oil, Sunflower Oil) (contains Soy Lecithin), Oligosaccharides [Galacto-Oligosaccharides (GOS) (from Milk), Fructo-Oligosaccharides (FOS)], Rice Crispies [Rice, Corn, Whey Powder (from Milk)], Minerals (Calcium, Iron, Iodine), Maltodextrin, Vitamins (Vitamin C, Vitamin E, Vitamin B1, Vitamin B6, Vitamin A, Biotin, Vitamin D3)</p>\r\n<p><strong>Allergy Information:</strong><br />Contains: Milk, Oats, Soya, Wheat<br />Storage<br />Please store this product in a cool dry place (not in the fridge) and once opened use within 28 days.Best Before Date: See top of pack.</p>\r\n<p>Produce of Manufactured in the E.U.</p>\r\n<p>Preparation and Usage</p>\r\n<ul>\r\n<li>Using a clean bowl and feeding spoon&hellip;</li>\r\n<li>Mix 1 spoonful of cereal with&hellip;</li>\r\n<li>1 1/2 spoonfuls of warm, previously boiled water and stir.</li>\r\n<li>If serving warm, check temperature before feeding.</li>\r\n<li>As your baby&rsquo;s appetite grows, use a larger spoon to make a bigger serving. This is only a guide, if you want to alter the consistency, add more or less water as required.</li>\r\n<li>Small soft pieces of food are best, once your baby can happily chew mashed foods, because the next step is for your baby to become used to food that is chewier. Why not add small fruits like blueberries or small chunks of bigger fruits such as mango, for a great taste and the right texture?</li>\r\n</ul>\r\n<p><br />Number of uses<br />Approximately seven 28g portions in this pack</p>\r\n<p>Additives<br />Free From Preservatives<br />Warnings<br />Important<br />Do not leave your baby alone whilst feeding.<br />Remember to clean your baby&rsquo;s teeth, especially before bedtime.<br />Name and address<br />Manufactured for:<br />Nutricia Ltd,<br />White Horse Business Park,<br />Trowbridge,<br />Wiltshire,<br />BA14 0XQ.<br />Return to<br />Quality guarantee<br />This product should reach you in perfect condition. If it is not satisfactory, please contact us. This guarantee does not affect your statutory rights.<br />Call on our expertise<br />Nutricia Ltd,<br />White Horse Business Park,<br />Trowbridge,<br />Wiltshire,<br />BA14 0XQ.<br />UK 0800 996 1000 (24/7 service)<br />www.aptaclub.co.uk<br />Nutricia Ireland,<br />Block 1,</p>\r\n<p><br />Lower age limit<br />7 Months</p>\r\n<p>&nbsp;</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 01:08:10', '2022-09-13 00:39:24'),
(375, 1, 'Boots Baby Organic Gluten Free Mini Stars 7 months+ 250g', '6', 6, NULL, 490, NULL, 0, NULL, 'UQMR92', 'gm', NULL, NULL, 250, 'single', '150', NULL, 'images/product/1655709110.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>Corn and rice based star shapes.</p>\r\n<ul>\r\n<li>No added preservatives</li>\r\n<li>No added colours</li>\r\n<li>No added flavours</li>\r\n<li>No added salt</li>\r\n</ul>\r\n<p>* Contains naturally occurring sodium.</p>\r\n<p>The Organic ingredients used in Boots Baby Organic have been carefully selected from fully-certified and inspected farming methods. Our products help provide your little one with a varied, balanced diet. Rice and corn based star shapes.</p>\r\n<p>Suitable for vegetarians.</p>\r\n<p>Money Back Guarantee: We know how difficult it is for mums &amp; dads to assess the quality of a product by just looking at the packaging. At Boots baby we are so proud of our own brand products that we would like you to try them on your baby and if you are not 100% happy with the result we will give you your money back! Money back guarantee on Boots brand baby products only. If you are not 100% happy with your purchase within 14 days we will give you a full refund (available on Boots brand baby products). To claim your refund please return your product to any Boots store with your original till receipt or online invoice (no photocopies will be accepted). Points received will be deducted from your Boots Advantage Card account. This does not affect your statutory rights.</p>\r\n<p><strong>How to use:</strong></p>\r\n<p>Serve with your choice of meat, fish or vegetables. Can be used with baby purees to add a little texture. Cook in boiling water for approx 8-10 minutes.</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<p>Important info</p>\r\n<p>Country of Origin: Italy<br />Manufacturer&rsquo;s Address: The Boots Company PLC, Nottingham, England NG2 3AA</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 01:11:50', '2022-09-13 00:39:06'),
(376, 1, 'Cow & Gate 3 Growing-Up Milk Formula 800g', '6', 6, NULL, 2890, NULL, 0, NULL, 'ZGFM87', 'gm', NULL, NULL, 800, 'single', '150', NULL, 'images/product/1655709355.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>Iron, calcium, vitamin D<br />Supports a balanced dietNo artificial preservatives*<br />*As required by legislation</p>\r\n<p>Iron to support normal cognitive development<br />Vitamin D &amp; Calcium for normal bone development</p>\r\n<p>What&rsquo;s next?<br />Running around the park? When your little one is two and getting even more active, they still need key nutrients. That&rsquo;s why Cow &amp; Gate Growing-up milk from 2-3 years is enriched with Calcium to support normal bone development as part of a varied and balanced diet.Over 100 years of trusted experience</p>\r\n<p>At Cow &amp; Gate, we believe little ones should grow and develop at their own pace and we&rsquo;re here to support you on your journey.<br />That&rsquo;s why Cow &amp; Gate Growing-up milk is nutritionally tailored to support your toddler&rsquo;s development between 1-2 years old, as part of a varied and balanced diet with just 2 beakers a day.</p>\r\n<p>x2 beakers a day help meet your toddler&rsquo;s daily Vitamin D, Calcium and Iron needs.</p>\r\n<p>Ready when they are!<br />When you are on the go, why not try our ready-to-use milks? No preparation needed, just pour it straight into your toddler&rsquo;s clean beaker.</p>\r\n<p>We are devoted to providing you and your toddler our very best. We don&rsquo;t produce for any supermarket own-label brands.Our specialist baby advisors and experienced mums are here to talk and ready to help whenever you need them.</p>\r\n<p>For information on Halal, visit our website.Packaged in a protective atmosphere.<br />Contents may settle in transit.Cow &amp; Gate&reg; is a registered trade mark.Fortified milk drink from 1-2 years.</p>\r\n<p><strong>How to use:</strong></p>\r\n<p>Feeding guide 1-2 years 1 beaker: Amount of water: 150 ml, 5 fl.oz; No. of level scoops (1 scoop = 5.0g): 5 From 1-2 years, we recommend giving your toddler about 2 x 150ml beakers of Cow &amp; Gate Growing-up milk a day. Important: Always use the scoop provided, please note the colour of the scoop in this pack may change from time to time. How to use this pack To open: remove tamper evidence strip and lift lid. In the pack is a scoop and leveller to help you measure the correct amount of powder. Store your scoop in the lid between uses. Click the lid securely shut to keep your powder fresh. How to prepare your toddler&rsquo;s milk Because powdered milks are not sterile, failure to follow preparation and storage instructions may make your toddler ill. 1 Measure 150ml or 5fl.oz of boiled, cooled water into a clean beaker. 2 Using the scoop provided, add 5 levelled scoops of powder into the beaker. 3 Replace clean lid on beaker. Shake immediately, vertically and vigorously for at least 10 seconds until the powder is dissolved. 4 Check temperature and drink immediately. Important feeding advice Make up each feed as required. For hygiene reasons, do not store made-up feeds, discard unfinished feeds as soon as possible, and always within 2 hours. Do not heat feeds in a microwave, hot spots may occur and cause scalding. Do not leave your toddler alone during eating and drinking.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Ingredients:</strong></p>\r\n<p>Skimmed MILK, Lactose (from MILK), Vegetable Oils (Palm Oil, Sunflower Oil, Rapeseed Oil), Whey Product (Demineralised Whey, Whey Protein Concentrate) (from MILK), Maltodextrin, Galacto-Oligosaccharides (GOS) (from MILK), Potassium Hydrogen Phosphate, Calcium Phosphate, Fructo-Oligosaccharides (FOS), Calcium Carbonate, Magnesium Citrate, Vitamin C, Potassium Citrate, Sodium Chloride, Emulsifier (SOY Lecithin), Potassium Chloride, Iron Sulphate, Zinc Sulphate, Vitamin D3, Vitamin E, Pantothenic Acid, Vitamin B12, Folic Acid, Niacin, Vitamin A, Riboflavin, Biotin, Vitamin B6, Thiamin, Potassium Iodide, Vitamin K1For allergens, see ingredients in BOLD. Contains: Milk, SoyaFree From: Artificial Preservati</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<p><strong>Important info:</strong></p>\r\n<p>Manufactured in the E.U.Country of Origin &ndash; Produce of the EU Nutricia Ltd, White Horse Business Park, Trowbridge, Wiltshire, BA14 0XQ. Nutricia Ireland Ltd, Block 1, Deansgrange Business Park, Deansgrange, Co. Dublin. Quality guarantee This product should reach you in perfect condition. If it is not satisfactory, please contact us. This guarantee does not affect your statutory rights.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 01:15:55', '2022-09-13 00:38:40');
