(377, 1, 'Cow & Gate 4 Growing Up Milk Formula 800g', '6', 6, NULL, 2890, NULL, 0, NULL, 'HO60WY', 'gm', NULL, NULL, 800, 'single', '150', NULL, 'images/product/1655709588.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>Growing up milk from 2-3 years<br />We believe that when little ones are happy on the inside, they&rsquo;re happy on the outside too.</p>\r\n<p>When it comes to looking after them, support, care &amp; nutrition can all help. Once your toddler is eating a wide range of different foods, you may choose to switch from a full-fat growing up milk to a semi-skimmed version. Our Stage 4 growing up milk is semi-skimmed and formulated to help provide 2-3 year olds with nutrients they need as part of a varied, balanced diet.</p>\r\n<p><strong>Features</strong></p>\r\n<ul>\r\n<li>High in vitamin D</li>\r\n<li>Enriched with Iron</li>\r\n<li>Source of Calciu</li>\r\n<li>Country of origin &ndash; Produce of the EU</li>\r\n<li>Name and address of manufacturer &ndash; Cow &amp; Gate, White Horse Business Park, Trowbridge, Wiltshire, BA14 0XQ.</li>\r\n</ul>\r\n<p><strong>How to use:</strong></p>\r\n<p>Feeding guide 2-3 years</p>\r\n<p>1 beaker, Amount of water 150ml, 5 fl.oz, Number of level scoops (1 scoop =4.0g): 5</p>\r\n<p>From 2-3 years, your toddler will need about 2 x 150ml beakers of growing up milk per day. We recommend one beaker in the morning and one at night.</p>\r\n<p>Always use the scoop provided, please note the colour of the scoop may change from time to time.</p>\r\n<p>How to use this pack</p>\r\n<p>To open: remove tamper evidence strip &amp; lift lid.</p>\r\n<p>In the pack is a scoop and leveller to help you measure the correct amount of powder. Store your scoop in the lid between uses.</p>\r\n<p>Click the lid securely shut to keep your powder fresh.</p>\r\n<p><strong>How to prepare</strong></p>\r\n<p>Because powdered milks are not sterile, failure to follow instructions may make your toddler ill.</p>\r\n<p>1 Measure 150ml or 5fl.oz boiled, cooled water into a clean beaker.</p>\r\n<p>2 Using the scoop provided, add 5 levelled scoops of powder into the beaker.</p>\r\n<p>3 Replace clean lid on beaker. Shake well for 10 seconds to dissolve powder.</p>\r\n<p>4 Check temperature and drink immediately.</p>\r\n<p>For hygiene reasons do not store made up milk drinks. Make up each drink as required and always discard unfinished drinks within 2 hours.</p>\r\n<p>Do not heat in a microwave, hot spots may occur and cause scalding.</p>\r\n<p>Storage: Use powder within 4 weeks of opening and store in a cool dry place. Do not refrigerate.</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<p>Country of origin &ndash; Produce of the EU</p>\r\n<p>Name and address of manufacturer &ndash; Cow &amp; Gate, White Horse Business Park, Trowbridge, Wiltshire, BA14 0XQ.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 01:19:48', '2022-09-13 00:38:20'),
(378, 1, 'Enfagrow Premium Toddler Nutritional Drink, Omega-3 DHA for Brain Support, Prebiotics & Vitamins for Immune Health, Non-GMO, Powder Can, 36.6 Oz', NULL, 6, NULL, 7590, NULL, 0, NULL, 'VPGGQF', 'Oz', NULL, NULL, 36.6, 'single', '150', NULL, 'images/product/1655714665.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p>Enfagrow Toddler Next Step is a milk-based nutritional drink for growing toddlers ages 1 year &amp; up. The transition from formula or breast milk to cow&rsquo;s milk can lead to a drop in brain-nourishing DHA consumption. That&rsquo;s why it&rsquo;s important to help promote your little one&rsquo;s brain development with Enfagrow Toddler Next Step. It contains DHA &amp; iron that helps nourish brain development. This helps fill the DHA gap with as little as two servings a day. It features prebiotics to help support immune health &amp; 22 total nutrients to complement the diet For toddlers one year and up.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>INGREDIENTS:</strong></p>\r\n<p>Nonfat Milk, Corn Syrup Solids, Vegetable Oil (Palm Olein, Coconut, Soy, And High Oleic Sunflower Oils), Sugar, Galactooligosaccharides&dagger;, Polydextrose&dagger;, And Less Than 1%: Magnesium Phosphate, Calcium Carbonate, Ferrous Sulfate, Zinc Sulfate, Manganese Sulfate, Cupric Sulfate, Natural And Artificial Flavor, Tuna Fish Oil&Dagger;, Ascorbic Acid, Niacinamide, Ascorbyl Palmitate, Calcium Pantothenate, Vitamin B6 Hydrochloride, Thiamin Hydrochloride, Riboflavin, Vitamin D3, Folic Acid, Biotin, Vitamin E Acetate, Vitamin A Palmitate, Soy Lecithin. Please refer to your product packaging for the most accurate information.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Preparation</strong></p>\r\n<p>Add 3 unpacked level scoops (1/3 cup, 36 g) of powder to 6 fluid ounces of water.<br />Shake well, serve immediately. Store DRY scoop in can.<br />Kiddiestreat is your one-stop baby shop for all your baby&rsquo;s needs. You can find the best of quality from a wide range of brand to serve your baby&rsquo;s needs. Our baby shop provides varieties of Baby food that include cereals, formula, snacks, drinks, yogurt, toiletries and a whole lot of others are made available here. Looking to buy your baby food and toiletries, you are at the right place.</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 02:44:25', '2022-09-13 00:36:55'),
(379, 1, 'Enfamil Milk-Based with Iron Infant Formula Powder 354g', '6', 6, NULL, 2750, NULL, 0, NULL, '8WDOS9', 'gm', NULL, NULL, 354, 'single', '150', NULL, 'images/product/1655716133.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '<p><strong>Key benefits</strong></p>\r\n<ul>\r\n<li>Gentle, complete nutrition tailored for your baby through their first 12 months</li>\r\n<li>Contains DHA &amp; Choline, important nutrients found in breast milk</li>\r\n<li>To help support cognitive brain development</li>\r\n<li>Enfamil is the #1 Infant Formula brand recommended by pediatricians</li>\r\n<li>An exclusive blend of dual prebiotics designed to support your baby\'s immune system</li>\r\n<li>It\'s unique triple health guard blend has 30 nutrients for growth</li>\r\n<li>No artificial flavors, sweeteners, or color</li>\r\n</ul>\r\n<p>&nbsp;</p>', '<p>Zam Zam Trading BD is a renowned name in marketing for dates and other healthy produce. &nbsp;We operate with the goal of providing premium quality products, Zam Zam Trading BD a name you can trust that are always ready to serve you. We do not compromise on our products or quality, all our products are carefully handpicked and each product is individually stored in temperature controlled facilities further preserving our products authenticity.</p>', '<ul>\r\n<li>Brand: Enfamil</li>\r\n<li>Made in USA</li>\r\n<li>Net weight:&nbsp;354g</li>\r\n</ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, '2022-06-20 03:08:53', '2022-09-13 00:36:27'),
