INSERT INTO `refunds` (`id`, `name`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Refund Policy', '<p style=\"text-align: center;\"><strong>RETURN POLICY</strong></p>\r\n<p><strong>Last updated&nbsp;March 20, 2023</strong></p>\r\n<p>Thank you for your purchase. We hope you are happy with your purchase. However, if you are not completely satisfied with your purchase for any reason, you may return it to us for&nbsp;a full refund or an exchange. Please see below for more information on our return policy.</p>\r\n<p><strong>RETURNS</strong></p>\r\n<p>All returns must be postmarked within&nbsp;seven (7)&nbsp;days of the purchase date. All returned items must be in new and unused condition, with all original tags and labels attached.</p>\r\n<p><strong>RETURN PROCESS</strong></p>\r\n<p>To return an item,&nbsp;please email customer service at&nbsp;info@ullash.com.bd&nbsp;to obtain a Return Merchandise&nbsp;Authorization&nbsp;(RMA) number. After receiving a RMA number,&nbsp;place the item securely in its original packaging&nbsp;and include your proof of purchase, then&nbsp;mail your return to the following address:</p>\r\n<p>Ullash</p>\r\n<p>3<sup>rd</sup> Floor, Pabtha Nibash, Panthapath</p>\r\n<p>Dhaka, Bangladesh</p>\r\n<p>Please note, you will be responsible for all return shipping charges. We strongly recommend that you use a trackable method to mail your return.&nbsp;If you return to the delivery person at the delivery time</p>\r\n<p><strong>REFUNDS</strong></p>\r\n<p>After receiving your return and inspecting the condition of your item, we will process your&nbsp;return or exchange. Please allow at least&nbsp;seven (7)&nbsp;days from the receipt of your item to process your&nbsp;return or exchange.&nbsp;We will notify you by email when your return has been processed.</p>\r\n<p><strong>EXCEPTIONS</strong></p>\r\n<p>The following items cannot be&nbsp;returned or exchanged:</p>\r\n<ul>\r\n<li>&nbsp; &nbsp;&nbsp;Customized products</li>\r\n<li>&nbsp; &nbsp;&nbsp;Cross bordered products</li>\r\n<li>&nbsp; &nbsp;&nbsp;Used after getting</li>\r\n<li>&nbsp; &nbsp;&nbsp;Without all actual packaging materials and documents</li>\r\n</ul>\r\n<p>For defective or damaged products, please contact us at the contact details below to arrange a refund or exchange.</p>\r\n<p><strong>QUESTIONS</strong></p>\r\n<p>If you have any questions concerning our return policy, please contact us at:</p>\r\n<p>+8801718964654</p>\r\n<p>info@ullash.com.bd</p>', 1, NULL, '2023-03-20 07:19:39');
